class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:
        """

        ## 用内置的find函数
        i = 0
        for c in s:
            j = t.find(c, i)    #从第i位置开始查找
            if j == -1:         #find函数找不到值时会返回-1
                return False
            i = j + 1           #从当前点的下一个位置开始查找
        return True

        :param s:
        :param t:
        :return:
        """
        dp = list(s)

        if s == "":
            return True

        for i in list(t):
            if len(dp) == 0:
                return len(dp) == 0

            if i == dp[0]:
                dp.pop(0)

        return len(dp) == 0


if __name__ == "__main__":
    sol = Solution()
    s = "leeeeetcode"
    t = ""
    print(sol.isSubsequence(s=s, t=t))

